import React from "react";

import Cards from "../../cards";
import JobComp from "./jobdesc";

const createJobandfeedback = (props) => {
  return (
    <Cards
      heading="Create JOB"
      desc="Kindly fill in the details to proceed"
      cont="CreateJob"
    >
      <JobComp/>
    </Cards>
  );
};

export default createJobandfeedback;
